/* eslint-disable jsx-a11y/heading-has-content */
import './App.css';
import React, {Component} from 'react';
 import Header from './components/Header';
import Product from './components/Product';
import Footer from './components/Footer';

class App extends Component{
  render(){
    var products = [
      {
        id  : 1,
        name: 'App Iphone 12 plus 128GB',
        status : true,
        price  :19000000,
        image : 'data:image/jpeg;base64,'
      },
      {
        id  : 2,
        name: 'App Iphone 13 plus 128GB',
        status : true,
        price  :24000000,
        image : 'data:image/jpeg;base64,'
      },
      {
        id  : 3,
        name: 'App Iphone 11 plus 128GB',
        status : true,
        price  :10000000,
        image : 'data:image/jpeg;base64,'
      },
      {
        id  : 4,
        name: 'App Iphone 10 plus 128GB',
        status : true,
        price  :11000000,
        image : 'data:image/jpeg;base64,'
      },
      {
        id  : 5,
        name: 'App Iphone 9 plus 128GB',
        status : false,
        price  :8000000,
        image : 'data:image/jpeg;base64,'
      },
    ];

    let elements = products.map((product, index) =>{
      if(product.status){
        return (
          <Product name = {product.name}
                   price =  {product.price}
                   image = {product.image} 
                   key   = {product.id}     
               />
        )
      }
    })
    return(
    <div>
    <Header></Header>

     <div className="container">

       <div className="row">

         <div className="row">
           <div className="col-xs-12 col-sm-12 col-md-12 col-lg-12">
            {elements}
           </div>

           <div class="col-xs-12 col-sm-12 col-md-12 col-lg-12">

              <button type="button" class="btn btn-default">clickMe</button>

           </div>

         </div>

       </div>

     </div>
     <Footer></Footer>
    </div>

    )
  }
}

export default App;
